func (r *Model2LocalRepo) IterWithTxn(
	txn *rony.StoreTxn, alloc *tools.Allocator, offset Model2PrimaryKey, ito *store.IterOption, cb func(m *Model2) bool,
) error {
	if alloc == nil {
		alloc = tools.NewAllocator()
		defer alloc.ReleaseAll()
	}

	var seekKey []byte
	opt := store.DefaultIteratorOptions
	opt.Reverse = ito.Backward()

	switch offset := offset.(type) {
	case Model2PK:
		opt.Prefix = alloc.Gen('M', C_Model2, uint64(17432954814955949437), offset.ID, offset.ShardKey)
		seekKey = alloc.Gen('M', C_Model2, uint64(17432954814955949437), offset.ID, offset.ShardKey, offset.P1)

	case Model2P1ShardKeyIDPK:
		opt.Prefix = alloc.Gen('M', C_Model2, uint64(13225238163999207549), offset.P1)
		seekKey = alloc.Gen('M', C_Model2, uint64(13225238163999207549), offset.P1, offset.ShardKey, offset.ID)

	default:
		opt.Prefix = alloc.Gen('M', C_Model2, uint64(17432954814955949437))
		seekKey = opt.Prefix
	}

	err := r.s.View(func(txn *rony.StoreTxn) (err error) {
		iter := txn.NewIterator(opt)
		if ito.OffsetKey() == nil {
			iter.Seek(seekKey)
		} else {
			iter.Seek(ito.OffsetKey())
		}
		exitLoop := false
		for ; iter.ValidForPrefix(opt.Prefix); iter.Next() {
			err = iter.Item().Value(func(val []byte) error {
				m := &Model2{}
				err := m.Unmarshal(val)
				if err != nil {
					return err
				}
				if !cb(m) {
					exitLoop = true
				}
				return nil
			})
			if err != nil || exitLoop {
				break
			}
		}
		iter.Close()

		return
	})

	return err
}

